import { styled } from "styled-components";

export function NextArrow(props) {
    const { NextSlide } = props;
    const onClick = () => {
        if(props.currentSide < 7) {
            console.log("다음으로")
        }
        else if(props.currentSide == 7) {
            console.log("유후")
        }
    }

    return (
        <button style={{
            border: "none", borderRadius: "100px", backgroundColor: "#23AA49",
            width: "80px", height: "45px", color: "white", fontSize: "16px", fontWeight: "bold",
            position: "absolute", bottom: "2%", right: "2%"
            }}
            onClick={() => {
                NextSlide
            }}
        >
            다음
        </button>
    )
}


export function PrevArrow(props) {
    const { onClick } = props;
    return (
        <button style={{
            border: "none", borderRadius: "100px", backgroundColor: "#23AA49",
            width: "106px", height: "53px", color: "white", fontSize: "16px", fontWeight: "bold",
            position: "absolute", bottom: "2%", right: "2%"
            }}
            onClick={onClick}
        >
            이전
        </button>
    )
}
